CREATE TABLE `cdp_organization` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '机构ID',
  `p_id` int(11) unsigned NOT NULL COMMENT '父机构编码，取值于id，表示当前数据所属的父类机构',
